            movingIntroduction: function () {
                console.log("coucou", this.currentSlide);
                switch (this.currentSlide) {
                    case 1:
                        this.$root.$emit("stopSound", AudioData.SOUND.SLIDE1)
                        this.$root.$emit("playSound", AudioData.SOUND.SLIDE2)
                        break;
                    case 2:
