                        this.$root.$emit("playSound", AudioData.SOUND.SLIDE4)
                        setTimeout(() => {
                            console.log("Salj");
                            this.$root.$emit("stopSound", AudioData.SOUND.SLIDE4)
                            this.$root.$emit("playSound", AudioData.SOUND.SLIDE5)
                        }, 7000)
                        break;
                }
                this.currentSlide += 1;
                this.slide.navigate('right')
            },
            stopIntroduction: function (data) {
                this.$root.$emit("stopSound", AudioData.SOUND.SLIDE5)
                this.$router.push('understand-introduction-tuto')
            }
        },

        methods: {
            nextSlide() {
